const React = require('react');

class Index extends React.Component {
  render() {
    return (
        <div>
            <nav>
                <a href="/blogs/new">Add New Blog </a>
            </nav>
            <h1>Blog Page</h1>
            <ul>
                {
                    this.props.blogs.map((blog, i)=>{
                        return(
                            <li>
                                The {blog.author} wrote {blog.title}
                            </li>
                        )
                    })
                }
            </ul>
        </div> );
  }
}

module.exports = Index;

